    [CascadingParameter]
    private Task<AuthenticationState> authenticationStateTask { get; set; }
    [CascadingParameter]
    private Task<AuthenticationState> _authState { get; set; }
    private AuthenticationState authState;
    ClaimsPrincipal MyClaims = new ClaimsPrincipal();

    List<vPRHeader> prHeaders;
    List<VPrList> vPrLists;
    private string fullName;
    Boolean isAccounting = false;
    Boolean isCoSign = false;
    int myUserId;

    protected override async Task OnInitializedAsync()
    {
        vPrLists = await prDataService.GetVPrListAsync();

        authState = await _authState;
        MyClaims = (await _authState).User;

        if (MyClaims.Identity.IsAuthenticated)
        {
            var myUserName = MyClaims.Claims.FirstOrDefault(c => c.Type == ClaimTypes.Name).Value;
            UserTable userTable = await prDataService.GetUserTableFromUseNameAsync(myUserName);
            myUserId = userTable.Pr_User_Id;

            //myUserId = Int16.Parse(MyClaims.Claims.FirstOrDefault(c => c.Type == "PrUserId").Value);

            List<vPRHeader> qPrHeaders = new List<vPRHeader>();
            List<vApproval_flow> approval_Flows = new List<vApproval_flow>();

            if (MyClaims.IsInRole("Accountings"))
            {
                approval_Flows.AddRange(await prDataService.GetvApprovalFlowForStatusAsync("A", "N"));
            }
            else if (MyClaims.IsInRole("CoSigner"))
            {
                approval_Flows.AddRange(await prDataService.GetvApprovalFlowForStatusAsync("C", "N"));
            }
            else
            {
                approval_Flows.AddRange(await prDataService.GetvApprovalFlowForUserIdAsync(myUserId, "N"));
            }
            foreach (vApproval_flow approval_Flow in approval_Flows)
            {
                if (prHeaders == null)
                {
                    prHeaders = new List<vPRHeader>();

                }
                prHeaders.Add(await prDataService.GetvPrHeaderAsync(approval_Flow.Pr_id));
            }



            List<WorkflowAutho> workflowAuthos;
            workflowAuthos = await prDataService.GetWorkflowAuthoAsync(myUserId);
            foreach (WorkflowAutho workflowAutho in workflowAuthos)
            {
                if (workflowAutho.IsRequester)
                {
                    // มี PR ODS ของเราที่เป็น NEW ที่รอยู่หรือไม่
                    qPrHeaders = await prDataService.GetPrHeaderNotCloseAsync(workflowAutho.Org, workflowAutho.Dep, workflowAutho.Sec);

                    if (qPrHeaders != null)
                    {
                        if (prHeaders == null)
                        {
                            prHeaders = qPrHeaders;
                        }
                        else
                            prHeaders.AddRange(qPrHeaders);
                    }
                }
            }

        }
    }

    protected void DoImport()
    {
        prDataService.Importer("0010225842.csv");
    }

    private void Navigate(vPRHeader prHeader1)
    {
        navigationManager.NavigateTo($"/prform/{prHeader1.Id}");
    }
    private void vNavigate(VPrList prList1)
    {
        navigationManager.NavigateTo($"/prform/{prList1.Id}");
    }

